import React from 'react';
import { Link } from 'react-router-dom';
import { toast, ToastContainer } from 'react-toastify';
import translator from '../Translator/translator';
import Contents from './Contents';

function Layout(props) {

    const notify = () => toast.success('ðŸ¦„ Wow so easy!', {
        position: "top-right",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: 0,
    });

    return (
        <>
            <header>
                <h2>geomanagement2</h2>
            </header>

            <section>
                <div>




                    {/*  NAV  ******************************************* */}
                    <div>
                        <nav>
                            <ul>
                                <Link to="/countries">
                                    <li>
                                        {translator("countries")}
                                    </li>
                                </Link>

                                <Link to="/countries/new">
                                    <li>
                                        {translator("countriesNew")}
                                    </li>
                                </Link>

                                <Link to="/provinces">
                                    <li>
                                        {translator("provinces")}
                                    </li>
                                </Link>

                                <Link to="/provinces/new">
                                    <li>
                                        {translator("provincesNew")}
                                    </li>
                                </Link>

                                <Link to="/cities">
                                    <li>
                                        {translator("cities ")}
                                    </li>
                                </Link>

                                <Link to="/cities/new">
                                    <li>
                                        {translator("citiesNew ")}
                                    </li>
                                </Link>
                            </ul>
                        </nav>
                    </div>

                    {/*  CONTENT  ******************************************* */}

                    <div className="content">
                        <div>
                            <button onClick={notify}>Notify!</button>
                            <ToastContainer
                                position="top-right"
                                autoClose={5000}
                                hideProgressBar={false}
                                newestOnTop={false}
                                closeOnClick={false}
                                rtl={false}
                                pauseOnFocusLoss={false}
                                draggable={false}
                                pauseOnHover={false}
                            />
                        </div>

                        <Contents />
                    </div>

                </div>
            </section>



            <footer>
                <p>Footer</p>
            </footer>
        </>
    );
}

export default Layout;
